class Test(TestCase):

    def test_distance(self):
        assert distance(X, Y) >= 0.0
        assert distance(X, Y) == distance(Y, X)

    def test_log_exp(self):
        # check Exp(Log)
        direction = log(X, Y)
        new_Y = exp(1, X, direction)
        np.testing.assert_almost_equal(Y, new_Y, decimal=10, err_msg='', verbose=True)
        np.testing.assert_almost_equal(distance(Y, new_Y), 0.0, decimal=10, err_msg='', verbose=True)
        #check Log(Exp)
        Y1 = exp(1, X, vector)
        new_vector = log(X, Y1)
        np.testing.assert_almost_equal(vector, new_vector, decimal=10, err_msg='', verbose=True)


    def test_parallel_translate(self):
        direction = log(X, Y)
        inner_product = np.inner(direction, vector)
        new_vector = parallel_translate(X, direction, vector)
        direction_back = log(Y, X)
        vector_again = parallel_translate(Y, direction_back, new_vector)
        new_inner_product = np.inner(direction, vector_again)
        np.testing.assert_almost_equal(inner_product, new_inner_product, decimal=10, err_msg='', verbose=True)
        np.testing.assert_almost_equal(vector, vector_again, decimal=10, err_msg='', verbose=True)

    # def test_pga2shape_shape2pga(self):
        # Vh, _, _ = PGA
        # pga = get_PGA_coordinates(X, Y)

    def test_landmark_affine_transform(self):

        # single shape
        shapes_gr, M, b = landmark_affine_transform(Y_phys)
        new_X = shapes_gr @ M + b
        np.testing.assert_almost_equal(Y_phys, new_X, decimal=10, err_msg='', verbose=True)

        # # array of shapes
        # shapes = np.vstack((X, Y))
        # shapes_gr, M, b = landmark_affine_transform(shapes)
        # new_shapes = shapes_gr @ M + b
        # np.testing.assert_almost_equal(shapes, new_shapes, decimal=10, err_msg='', verbose=True)

    
    def test_procrustes(self):

        # Recover angle
        R1 = np.array([[np.cos(np.pi/2), np.sin(np.pi/2)], [- np.sin(np.pi/2), np.cos(np.pi/2)]])
        new_R1 = procrustes(Y, Y @ R1)
        np.testing.assert_almost_equal(R1, new_R1, decimal=10, err_msg='', verbose=True)


